  return (
    <div className='header'>
        <div className="header_ordi">
        <Link to="/accueilo" className={`navbar-link ${isActive('/accueilo')}`}>
        <FontAwesomeIcon icon={faHome} size="2x" />
        <div>Accueil</div>
      </Link>
        </div>
    </div>

  );
};

export default Navordi;
